import React from 'react'

export default function Contact() {
  return (
    <div className = "contact">
      <hr></hr>
      <h3>Contact</h3>
      <p>
        Email: {}
      </p>

      <style>
        {`
         .contact hr{
          border-width:2px;
          font-weight:bold;
         }

         .contact{
          background-color:#f0f0f0;
          text-align:center;
         }
        `}
      </style>
    </div>
  )
}
